{"7": ["Отличный наполнитель", "2021-04-13T13:42:10Z", "", "0", 1, 0, 5, "Наполнитель силикагелевый \"Чистый котик\" с синими гранулами 5л", "Чистый Котик"], "12": ["Рекомендую.", "2021-03-25T20:18:46Z", "", "0", 0, 1, 5, "Наполнитель силикагелевый \"Чистый котик\" с синими гранулами 5л", "Чистый Котик"], "15": ["Беру уже не первый раз. Всё устраивает.", "2021-03-08T14:15:28Z", "", "0", 2, 0, 5, "Наполнитель силикагелевый \"Чистый котик\" с синими гранулами 5л", "Чистый Котик"], "20": ["Пришёл запакованный в целофановый пакет, рассыпанный. Вес не соответствует, нет даже двух килограммов, 1900гр. Брала до этого МУРЗИК, в нем 4л., вес 2500гр. Здесь же написано 5л.", "2021-02-19T18:14:08Z", "", "0", 1, 0, 3, "Наполнитель силикагелевый \"Чистый котик\" с синими гранулами 5л", "Чистый Котик"], "22": ["Доставка на следующий день. Запечатан ещё в один пакет. Беру первый раз. Пока не пробовал.", "2021-02-07T12:42:30Z", "", "0", 0, 1, 5, "Наполнитель силикагелевый \"Чистый котик\" с синими гранулами 5л", "Чистый Котик"], "26": ["Хороший наполнитель:) В комочки не собирается. Запаха нет", "2020-11-11T16:59:19Z", "", "0", 0, 1, 4, "Наполнитель силикагелевый \"Чистый котик\" с синими гранулами 5л", "Чистый Котик"], "27": ["Наполнитель не понравился. Больше не куплю. Запах появился через несколько дней. Перемешиваю ежедневно. Внизу мокрый комок практически сразу образовался.", "2020-11-05T07:56:52Z", "", "0", 1, 1, 1, "Наполнитель силикагелевый \"Чистый котик\" с синими гранулами 5л", "Чистый Котик"], "29": ["Взяла \"Чистый Котик\" третий раз. Кошка у меня год за это время попробова разные наполнители  Остановилась на этом. Почему-то его кошка не рассыпает. Гранулы разной формы, но именно этот наполнитель не нахожу потом на полу! Запаха тоже нет! Насыпаю немного под решётку и немного сверху. На неделю хватает. Пакет 5 литров на 4-5 недель. Может дорогова -то, но устраивает качество. Спасибо! Здорово, что производитель Россия.", "2020-01-08T08:22:37.377574234Z", "colorless", "0", 6, 1, 5, "Наполнитель силикагелевый \"Чистый котик\" с синими гранулами 5л", "Чистый Котик"], "31": ["Отвратительный наполнитель, воняет ужасно, единственный плюс только в том, что к лапам не липнет. Этот же производитель Тофу с лавандой в 100 раз лучше.", "2020-10-31T08:48:23Z", "", "0", 2, 0, 1, "Наполнитель силикагелевый \"Чистый котик\" с синими гранулами 5л", "Чистый Котик"], "35": ["Запах держит, меняю раз в неделю. Экономичный, не пылит. Правда к лапам котёнка прилипает ( ", "2020-10-19T14:25:19Z", "", "0", 1, 0, 4, "Наполнитель силикагелевый \"Чистый котик\" с синими гранулами 5л", "Чистый Котик"], "39": ["Хороший наполнитель, неейтрализует запах на пять с плюсом. Кошка вроде бы тоже нормально.", "2020-10-06T08:12:12Z", "", "0", 1, 0, 5, "Наполнитель силикагелевый \"Чистый котик\" с синими гранулами 5л", "Чистый Котик"], "41": ["Все пришло целое, пакет не порван. Этот наполнитель я уже знаю, мне он очень нравится. Впитывает очень хорошо, запах устраняет. Заказывайте. Я тоже буду заказывать", "2020-09-21T17:01:57Z", "", "0", 1, 0, 5, "Наполнитель силикагелевый \"Чистый котик\" с синими гранулами 5л", "Чистый Котик"], "43": ["Хороший наполнитель. Кто писал что слишком мелкие гранулы - не правда, они среднего размера. Хватит такого пакета надолго", "2020-09-21T04:46:58Z", "", "0", 1, 0, 5, "Наполнитель силикагелевый \"Чистый котик\" с синими гранулами 5л", "Чистый Котик"], "44": ["Наполнитель где-то ездил, опаздал почти на неделю. Пришёл порванный, закалённый скотчем. Вместо 5 л пришло литра 3. Остальное    видно рассыпалось по дороге. Забирал ребёнок. Если бы я забирала, естественно такое безобразие не взяла. Зла на такую доставку. Больше не буду заказывать. ", "2020-09-20T12:43:00Z", "", "0", 3, 0, 1, "Наполнитель силикагелевый \"Чистый котик\" с синими гранулами 5л", "Чистый Котик"], "45": ["Объёма 5 литров хватило меньше чем на месяц(примерно на 25 дней). Пылит немного, не комкуется, но запаха почти нет, если вовремя убирать использованный наполнитель. Можно смывать в унитаз. По сравнению с древесным наполнителем - отсутствие опилок по всех квартире. Не знаю прилипает ли к лапам или это результат усердного закапывания, но лучше пусть немного таких кристаллов будет раскидано, чем опилок.\nЭто мой первый опыт с таким наполнителем, вполне достойный.", "2020-09-19T15:07:10Z", "", "0", 2, 0, 4, "Наполнитель силикагелевый \"Чистый котик\" с синими гранулами 5л", "Чистый Котик"], "47": ["Качество на 3, быстро расходуется, запах плохо держит", "2020-09-14T16:23:20Z", "", "0", 1, 0, 3, "Наполнитель силикагелевый \"Чистый котик\" с синими гранулами 5л", "Чистый Котик"], "48": ["Желтеет сразу после, запах на всю квартиру после того как посрал кот", "2020-09-05T07:41:29Z", "", "0", 0, 9, 2, "Наполнитель силикагелевый \"Чистый котик\" с синими гранулами 5л", "Чистый Котик"], "49": ["Самый лучший наполнитель из всех что покупали коту. Экономичный. Высокая адсорбирующая способность, хорошо держит запах", "2020-08-26T16:34:15Z", "", "0", 3, 0, 5, "Наполнитель силикагелевый \"Чистый котик\" с синими гранулами 5л", "Чистый Котик"], "50": ["Кот наполнителем остался доволен. Мы соответственно тоже.", "2020-08-21T11:22:57Z", "", "0", 1, 0, 5, "Наполнитель силикагелевый \"Чистый котик\" с синими гранулами 5л", "Чистый Котик"], "54": ["Почему то объем 5 литров этого наполнителя меньше чем из *** объемом 3.8 литра, как так? Я так понимаю это объем пакета, жадные, жадные бяки.Жирный минус.", "2020-08-03T14:03:29.661734419Z", "colorless", "0", 6, 0, 1, "Наполнитель силикагелевый \"Чистый котик\" с синими гранулами 5л", "Чистый Котик"], "55": ["Наполнитель понравился, не заметила пыли -если только немного на дне пакета. В лоток сыпью на и под решётку. Иногда сверху древесный,  а вниз этот. Запах держит хорошо.", "2020-07-29T18:05:37.603213835Z", "colorless", "0", 0, 1, 5, "Наполнитель силикагелевый \"Чистый котик\" с синими гранулами 5л", "Чистый Котик"], "57": ["По сравнению с аналогами,запах не убивает,и не сильно впитывает.дня два без запаха стоит максимум,аналоги до 6дней", "2020-07-21T10:53:52.148827966Z", "colorless", "0", 1, 0, 1, "Наполнитель силикагелевый \"Чистый котик\" с синими гранулами 5л", "Чистый Котик"], "59": ["Беру 2 раз. Все нравится: запах удерживает, с 2мя кошками хватает пол пакета на 2,5-3 недели (лоток большой). Да, пылит, но для меня это не критично. И по цене очень устраивает. Буду брать еще.", "2020-07-06T06:46:00.948873742Z", "colorless", "0", 1, 0, 5, "Наполнитель силикагелевый \"Чистый котик\" с синими гранулами 5л", "Чистый Котик"], "62": ["Не понравился. Запах не удерживает и пылит.", "2020-06-18T19:55:35.986368468Z", "colorless", "0", 1, 0, 2, "Наполнитель силикагелевый \"Чистый котик\" с синими гранулами 5л", "Чистый Котик"], "63": ["Отличный наполнитель.  Запах держит 100%. Советую .", "2020-06-14T10:44:14.938984152Z", "colorless", "0", 1, 0, 5, "Наполнитель силикагелевый \"Чистый котик\" с синими гранулами 5л", "Чистый Котик"], "65": ["Не понравился совсем!! Деньги на ветер. Не удерживает запах. Котёнку около 4-х месяцев всего. Горшок закрытым домиком. Ужас просто ", "2020-06-06T17:12:33.459296356Z", "colorless", "0", 1, 1, 1, "Наполнитель силикагелевый \"Чистый котик\" с синими гранулами 5л", "Чистый Котик"], "67": ["Не на долго хватает. Запах держит не очень долго. Лучше купить подороже. Не рекомендую. ", "2020-06-02T08:40:31.149358614Z", "colorless", "0", 1, 0, 3, "Наполнитель силикагелевый \"Чистый котик\" с синими гранулами 5л", "Чистый Котик"], "69": ["Пришёл весь рассыпаный, упаковка порвана , фотографировать не стала, т. к. это бесполезно, вы так и будете доставлять такой товар", "2020-05-24T15:11:17.075131003Z", "colorless", "0", 2, 1, 1, "Наполнитель силикагелевый \"Чистый котик\" с синими гранулами 5л", "Чистый Котик"], "71": ["Отлично держит жидкость и запах, буду заказывать ещё. ", "2020-05-04T18:39:12.379496066Z", "colorless", "0", 0, 1, 5, "Наполнитель силикагелевый \"Чистый котик\" с синими гранулами 5л", "Чистый Котик"], "74": ["Покупала уже 4 раза. Кошке нравилось. Сейчас в \"ленте\" нашла дешевле. Может позже  снова закажу.", "2020-04-25T12:24:31.076922109Z", "colorless", "0", 1, 0, 4, "Наполнитель силикагелевый \"Чистый котик\" с синими гранулами 5л", "Чистый Котик"], "77": ["Мне качество не очень понравилось . В отзывах на фото наполнитель крупный ,по факту пришел гораздо мельче. И от жидкости как песок становится . Ранее брала другие марки гораздо лучшего качества .", "2020-04-19T16:39:18.681954508Z", "colorless", "0", 1, 0, 4, "Наполнитель силикагелевый \"Чистый котик\" с синими гранулами 5л", "Чистый Котик"], "78": ["Наполнитель не плохой только цена постоянно меняется", "2020-04-16T17:35:59.974748538Z", "colorless", "0", 1, 0, 5, "Наполнитель силикагелевый \"Чистый котик\" с синими гранулами 5л", "Чистый Котик"], "80": ["Отличная цена, покупаю в магазине по 500р, но после цена ещё упала на 380р...", "2020-04-14T09:45:46.399954708Z", "colorless", "0", 0, 1, 5, "Наполнитель силикагелевый \"Чистый котик\" с синими гранулами 5л", "Чистый Котик"], "82": ["Рада, что заказала здесь наполнитель. В других магазинах гораздо дороже, качество отличное. Рекомендую.", "2020-04-12T21:08:08.124690412Z", "colorless", "0", 0, 1, 5, "Наполнитель силикагелевый \"Чистый котик\" с синими гранулами 5л", "Чистый Котик"], "86": ["Пакет рваный , забирать не стала. Не знаю сколько высыпалось. Зачем отправлять некачественный товар", "2020-04-08T10:18:01.25318391Z", "colorless", "0", 1, 0, 1, "Наполнитель силикагелевый \"Чистый котик\" с синими гранулами 5л", "Чистый Котик"], "87": ["Котик оценил. Стал есть.", "2020-04-07T16:57:05.579470252Z", "colorless", "0", 6, 0, 5, "Наполнитель силикагелевый \"Чистый котик\" с синими гранулами 5л", "Чистый Котик"], "89": ["Не доставлен,  в приложении отметили, что товар получен.", "2020-03-31T16:12:49.193510005Z", "colorless", "0", 1, 2, 1, "Наполнитель силикагелевый \"Чистый котик\" с синими гранулами 5л", "Чистый Котик"], "90": ["Наполнитель хороший,но дороговато.Если производитель снизит цену в два раза,будем покупать постоянно", "2020-03-25T14:09:26.679396206Z", "colorless", "0", 2, 4, 5, "Наполнитель силикагелевый \"Чистый котик\" с синими гранулами 5л", "Чистый Котик"], "94": ["Наполнитель был доставлен в новой целой упаковке, дополнительно ещё запаян в целлофан. К WB никаких вопросов. Сам наполнитель разочаровал: 1. Мелкая фракция и пыль. Крупных гранул просто нет. 2. Вызывает сомнение заявленный объём в 5 литров. В моём случае там максимум 4 литра. Возможно, это и связано с тем, что мне просто отсыпали пакетик пыли. Однозначно не рекомендую!", "2020-03-08T10:28:56.219414693Z", "colorless", "0", 6, 0, 1, "Наполнитель силикагелевый \"Чистый котик\" с синими гранулами 5л", "Чистый Котик"], "95": ["Зооник наполнитель совсем плохой стал. Превращается в липкую глину, прилипает к лотку, не отодрать. Стоят в запасе несколько упаковок, больше брать не буду. Не дорого, но плохо. Чтобы улучшить ситуацию, стала подсыпать к нему ЧИСТЫЙ КОТИК. Примерно треть, или четверть от ЗООНИК\"а. Перемешиваю. Стало лучше, возможно это хороший выход из положения. И на фирме в том числе.", "2020-03-05T18:29:57.331957919Z", "colorless", "0", 2, 0, 5, "Наполнитель силикагелевый \"Чистый котик\" с синими гранулами 5л", "Чистый Котик"], "96": ["Пакет пришёл порванным! Отказ. Не учитывайте % выкупа ", "2020-03-05T09:44:22.476817098Z", "colorless", "0", 0, 3, 3, "Наполнитель силикагелевый \"Чистый котик\" с синими гранулами 5л", "Чистый Котик"], "97": ["Упаковка порвана, отказ! Не учитывайте % выкупа ", "2020-03-05T09:46:02.728728986Z", "colorless", "0", 0, 1, 3, "Наполнитель силикагелевый \"Чистый котик\" с синими гранулами 5л", "Чистый Котик"], "99": ["Отличный наполнитель. Лучше на большой лоток брать 5л, а не 3л. На долго хватает, месяц и более.", "2020-02-27T09:22:34.250468334Z", "colorless", "0", 3, 1, 5, "Наполнитель силикагелевый \"Чистый котик\" с синими гранулами 5л", "Чистый Котик"], "101": ["Наполнитель не мелкий, упаковка была целая. НО!! Пылит ужасно! Пока в лоток насыпала сама чуть не задохнулась! Потом кот пошёл в лоток, пошуршал там, снова пыль поднял и сам еле продышался потом!!", "2020-02-29T17:12:55.717964995Z", "colorless", "0", 1, 0, 3, "Наполнитель силикагелевый \"Чистый котик\" с синими гранулами 5л", "Чистый Котик"], "105": ["Наполнитель силикагелевый \"Чистый котик\" котятам очень понравился) Они его стали кушать) брали котятам очень хорошо его приняли кошечка и котик взрослые. ! Наполнитель очень хороший ,в комментариях видела писали про пыль...бред кристаллы идеальны...не липнет к лапкам и все,что написано в описании правда. Спасибо Вайберису и представителям Бренда !!!", "2020-02-17T20:24:34.030724062Z", "colorless", "0", 1, 0, 5, "Наполнитель силикагелевый \"Чистый котик\" с синими гранулами 5л", "Чистый Котик"], "108": ["Наполнитель не понравился, очень быстро рассыпается в мелкую пыль, не экономично.", "2020-02-17T15:03:14.760120137Z", "colorless", "0", 1, 0, 1, "Наполнитель силикагелевый \"Чистый котик\" с синими гранулами 5л", "Чистый Котик"], "110": ["Хороший наполнитель", "2020-02-14T05:51:16.198799423Z", "colorless", "0", 0, 1, 5, "Наполнитель силикагелевый \"Чистый котик\" с синими гранулами 5л", "Чистый Котик"], "111": ["Упаковка пришла рваная, на весах 1.9, т.е 100 гр рассыпалось, или кто-то на складе  отсыпает для своей кисы... Отзыв дополню, как по качеству, чуть позже..", "2020-01-28T16:07:42.901382595Z", "colorless", "0", 1, 2, 4, "Наполнитель силикагелевый \"Чистый котик\" с синими гранулами 5л", "Чистый Котик"], "117": ["Наполнитель очень понравился. Кошка в восторге.", "2020-02-08T15:33:04.818444751Z", "colorless", "0", 0, 1, 5, "Наполнитель силикагелевый \"Чистый котик\" с синими гранулами 5л", "Чистый Котик"], "119": ["Из всех наполнителей, именно силикагель, этот самый ужасный, запах не держит вообще, через 3 дня стояла ужасная вонь", "2020-02-07T18:29:05.498220847Z", "colorless", "0", 2, 2, 1, "Наполнитель силикагелевый \"Чистый котик\" с синими гранулами 5л", "Чистый Котик"], "121": ["Отли